### Summary of Core Topics, Concepts, Principles, and Equations

#### Core Topics and Concepts

1. **Search Algorithms**
   - **Depth First Search (DFS)**
     - Explores as far as possible along each branch before backtracking.
     - Uses a stack to keep track of nodes.
   - **Breadth First Search (BFS)**
     - Explores all neighbors at the present depth before moving on to nodes at the next depth level.
     - Uses a queue to keep track of nodes.
   - **Best First Search**
     - Explores nodes based on a priority queue, often using a heuristic to determine the order of exploration.
   - **Hill Climbing**
     - A local search algorithm that continuously moves to the best neighboring state.
     - Can get stuck in local optima.

2. **State Space Search**
   - **State Representation**
     - Representing states in a problem, e.g., LEFT/RIGHT in the boat problem.
   - **Actions/Moves**
     - Defining possible actions/moves from one state to another.
   - **Safe and Unsafe States**
     - Identifying states where certain conditions are met or violated.

3. **Simulated Annealing**
   - A probabilistic technique for approximating the global optimum of a given function.
   - Involves a single agent generating random neighbors and potentially moving to them based on a probability function.

4. **Traveling Salesman Problem (TSP)**
   - **Nearest Neighbor Heuristic**
     - Constructs a tour by always moving to the nearest unvisited city.
   - **Greedy Heuristic**
     - Constructs a tour by always choosing the shortest available edge.
   - **Savings Heuristic**
     - Combines routes to maximize savings, often used in vehicle routing problems.
   - **Path Representation**
     - Representing a tour as a sequence of cities.
   - **Adjacency Representation**
     - Representing a tour as a list of adjacent cities.
   - **Ordinal Representation**
     - Representing a tour using ordinal numbers.
   - **Partially Mapped Crossover (PMX)**
     - A genetic algorithm crossover operator used to generate offspring from parent tours.

5. **Graph Representation**
   - **Nodes and Edges**
     - Representing locations and connections between them.
   - **Manhattan Distance**
     - A distance metric used in grid-based pathfinding.

#### Important Equations

1. **Manhattan Distance**
   \[
   d(p, q) = |p_x - q_x| + |p_y - q_y|
   \]
   where \( p \) and \( q \) are points on a grid.

2. **Savings in Savings Heuristic**
   \[
   s_{ij} = d_{i0} + d_{0j} - d_{ij}
   \]
   where \( d_{i0} \) is the distance from city \( i \) to the fulcrum node, \( d_{0j} \) is the distance from the fulcrum node to city \( j \), and \( d_{ij} \) is the distance from city \( i \) to city \( j \).

